class AsyncTask{async doGet(o,t){let e=o;if(t.length>0){let o=Object.entries(t).map(([o,t])=>`${o}=${encodeURIComponent(t)}`).join("&");e=`${e}?${o}`}Log.i("doGet --> "+e);let n={method:"GET",mode:"cors",cache:config.cache,headers:{"Content-Type":"application/json"}};const a=await fetch(e,n);if(a.ok)return await a.json();throw new Error(a.status)}async doPostMessage(o,t){let e=o,n={method:void 0!==t.id&&null!==t.id?"PUT":"POST",mode:"cors",cache:"no-cache",headers:{"Content-Type":"application/json"},body:JSON.stringify(t)};Log.i(e);const a=await fetch(e,n);if(a.ok)return await a.json();throw new Error(a.status)}async doImport(o){return Log.d("doImport : "+o),await import(o).then(o=>o)}}export{AsyncTask};